import "./App.css";
import {Router, Route, BrowserRouter} from "react-router-dom"

const App = () => {
  
  return (
    <>
  <BrowserRouter>
    <Router>
    <Route path="/" element={<h1>todo component</h1>}/>
    <Route path="/login" element={<h1>todo component</h1>}/>
    <Route path="/" element={<h1>todo component</h1>}/>
    </Router>
  </BrowserRouter>
    </>
  );
};

export default App;
